<html lang="en">
<head>
    <meta charset="utf-8">

    <style type="text/css">
        .tooltip {
            font-size: 12px;
            width: 250px;
            height: 65px;
            position: fixed;
            text-align: center;
            border-style: solid;
            border-width: 0px;
            background-color: #cef1a8;
            display: none;
            /***border-radius:5px;***/
        }

        .text_a {
            color: #01AAED;
        }

        .text_a:hover {
            color: red;
        }

        .loading {
            position: absolute;
            top: 300px;
            left: 300px;
            /*transform: translate(-50%, -50%);*/
            width: 50px;
            height: 50px;
            border-radius: 50%;
            border: 5px solid #ccc;
            border-top-color: #333;
            animation: spin 1s ease-in-out infinite;
            display: none;
        }

        @keyframes spin {
            to {
                transform: rotate(360deg);
            }
        }
    </style>

<section>
    <div class="container" style="height: 1000px;width: 1430px;">
        <div class="loading" style="width: 20px;height: 20px;position: absolute;background-color: rgba(198,20,20,0.3)"></div>
        <div id="synteny" style="border: #e04141 solid 1px;width: 976px;height: 450px;float: left">
            <div style="float: right">
                <button onclick="onSaveSvg('svg')">save Svg</button>
                <button id="imgSave">save Png</button>
                <button id="reFresh" onclick="reFresh()">Refresh</button>
            </div>
        </div>
        <div id="dotplot" style="border: #e04141 solid 1px;width: 450px;height: 450px;float: left">
            <div style="float: right">
                <button onclick="onSaveSvg('d_svg')">save Svg</button>
                <button id="imgsSave">save Png</button>
                <button onclick="startBrush()">Checkbox</button>
                <button onclick="stopBrush()">Close checkbox</button>
                <button id="reFreshs" onclick="reFreshs()">Refresh</button>
            </div>
        </div>
        <div style="width: 1427px;height: 450px;border: 2px solid red;float: left;overflow-y: auto" contenteditable="true" id="text"></div>
    </div>
    <div class="container_bottom"></div>
</section>

        let species1 = $('#select1').val()
        let species2 = $('#select2').val()
        svg.selectAll("rect").remove()
        svg.selectAll("path").remove()
        svg.selectAll("text").remove()
        d_svg.selectAll("circle").remove()
        d_svg.selectAll("line").remove()
        d_svg.selectAll("text").remove()

    // 在这里可以处理两个数据
    function draw_synteny() {
        let x_chr, y_chr, chr1, chr2, Width, chr1_n, chr2_n, colors1, colors2, lens1, lens2;
        x_chr = chr_dir[spe1];
        y_chr = chr_dir[spe2];
        [lens1, chr1] = lens(x_chr, spe1);
        [lens2, chr2] = lens(y_chr, spe2);
        let chr1_sum = sum_len(chr1)
        let chr2_sum = sum_len(chr2)
        colors1 = d3.quantize(d3.interpolateRainbow, chr1.length);
        colors2 = d3.quantize(d3.interpolateRainbow, chr2.length);

        let chr_num = ''
        if (chr1_sum >= chr2_sum) {
            chr_num = chr1.length - 1
            chr1_n = chr1_sum / 50
            Width = chr1_sum + chr_num * chr1_n
            chr2_n = (Width - chr2_sum) / (chr2.length - 1)
        } else {
            chr_num = chr2.length - 1
            chr2_n = chr2_sum / 50
            Width = chr2_sum + chr_num * chr2_n
            chr1_n = (Width - chr1_sum) / (chr1.length - 1)
        }
        xScale = d3.scaleLinear()
            .domain([0, Width])
            .range([0, 800]);

        legend_write(chr1, chr2, colors1, colors2);
        var pathUpdate = svg.selectAll("path").data(dataset);
        var pathEnter = pathUpdate.enter().append("path");
        pathEnter.attr('d', function (d) {
            let dx = 0, dy = 150;
            let x1 = padding.left + xScale(d['s1']) + xScale(lens1[Number(d['c1'].slice(3)) - 1]) + chr1_n * xScale(Number(d['c1'].slice(3)) - 1)
            let x2 = padding.left + xScale(d['s2']) + xScale(lens2[Number(d['c2'].slice(3)) - 1]) + chr2_n * xScale(Number(d['c2'].slice(3)) - 1)
            let cpx1 = x1 - dx;
            let cpy1 = Y1 + dy;
            let cpx2 = x2 + dx;
            let cpy2 = Y2 - dy;
            return 'M ' + x1 + ' ' + Y1 + ' L ' + (x1 + xScale(d['len1'])) + ' ' + Y1 + ' C ' + cpx1 + ' ' + cpy1 + ', ' + cpx2 + ' ' + cpy2 + ', ' + (x2 + xScale(d['len2'])) + ' ' + Y2 + ' L ' + (x2 + xScale(d['len2'])) + ' ' + Y2 + ' L ' + x2 + ' ' + Y2 + ' C ' + cpx2 + ' ' + cpy2 + ', ' + cpx1 + ' ' + cpy1 + ', ' + x1 + ' ' + Y1 + ' Z';
        })
            .attr("class", function (d) {
                return d['c1'] + ' ' + d['c2']
            })
            .style('fill', function (d) {
                return colors1[Number(d['c1'].slice(3)) - 1]
            })
            .style('stroke', function (d) {
                return colors1[Number(d['c1'].slice(3)) - 1]
            })
            .style('stroke-width', 1)
            .on("mouseover", function (d, i) {
                d3.select(this).style('fill', 'red').style('stroke', 'red')
                tooltip
                    .html(i['c1'] + ': <br>' + i['g1'] + '-' + i['g11'] + '<br>' + i['c2'] + ': <br>' + i['g2'] + '-' + i['g22'])
                    .style("display", "block")
                    .style("left", (d.x + 1) + "px")
                    .style("color", "black")
                    .style("top", (d.y + 1) + "px")
                let line_list = i['gene'].split('\n')
                for (let line in line_list) {
                    let va = line_list[line].split('\t')
                    let classname = "." + va.slice(0, 2).join("-").replaceAll(".", "-")
                    d3.selectAll(classname).style('fill', 'green').attr("r", 1)
                }
            })
            .on("mouseout", function (d, i) {
                d3.select(this).style('fill', colors1[Number(i['c1'].slice(3)) - 1]).style('stroke', colors1[Number(i['c1'].slice(3)) - 1])
                tooltip.style("display", "none")
                let line_list = i['gene'].split('\n')
                for (let line in line_list) {
                    let va = line_list[line].split('\t')
                    let classname = "." + va.slice(0, 2).join("-").replaceAll(".", "-")
                    d3.selectAll(classname).style('fill', 'red').attr("r", 0.4)
                }
            })
            .on("click", function (d, i) {
                let text = document.getElementById("text")
                text.innerHTML = '<b>query id(' + spe1 + '), subject id(' + spe2 + '), evalue, bit score<br></b>'
                let gene_list = i['gene'].split('\n').slice(0, -1)
                for (let a in gene_list) {
                    let gen = gene_list[a].split('\t')
                    text.innerHTML += '<a contenteditable="false" class="text_a" href="#">' + gen[0] + '</a>\t<a contenteditable="false" class="text_a" href="#">' + gen[1] + '</a>\t' + gen[2] + '\t' + gen[3] + '<br>'
                }
            })
        chrWrite(chr1, Y1, 10, chr1_n, -10, colors1);
        chrWrite(chr2, Y2, 10, chr2_n, 22, colors2);
    }

    function draw_dotplot() {
        //update
        let x_chr, y_chr, chr1, chr2, lens1, lens2, sum1, sum2;
        x_chr = chr_dir[spe1];
        y_chr = chr_dir[spe2];
        [lens1, chr1] = lens(x_chr, spe1);
        [lens2, chr2] = lens(y_chr, spe2);
        sum1 = sum(x_chr)
        sum2 = sum(y_chr)

        draw_frame(d_svg, x_chr, y_chr, d_width, d_height);  //画框架结构
        rectWrite(d_svg, [padding.left, padding.top], d_width, d_height, "black", "2px");
        var circleUpdate = d_svg.selectAll("circle").data(datasets);
        //enter
        var circleEnter = circleUpdate.enter().append("circle");
        circleEnter
            .attr("r", 0.4)
            .attr("class", function (d, i) {
                let va = d['value'].split('\t')
                return va.slice(0, 2).join("-").replaceAll('.', '-');
            })
            .attr("fill", '#FF0000')
            .attr("cx", function (d) {
                return padding.left + d_xScale((Number(d['x']) + lens1[Number(d['c1'].slice(3)) - 1]) / sum1);
            })
            .attr("cy", function (d, i) {
                return d_height + padding.top - d_yScale(1 - (Number(d['y']) + lens2[Number(d['c2'].slice(3)) - 1]) / sum2);
            });
        circleEnter.on("mouseover", function (d, i) {
            let va = i['value'].split('\t')
            d3.select(this).style("fill", 'green')
            tooltip
                .html('x: ' + va[0] + '<br>y: ' + va[1] + '<br>E_value: ' + va[2] + '<br>Score: ' + va[3])
                .style("display", "block")
                .style("left", d.x + 1 + 'px')
                .style("color", '#ff0000')
                .style("top", d.y + 1 + 'px');
        })
            .on("mouseout", function () {
                d3.select(this).style('fill', 'red')
                tooltip.style("display", "none")
            })
            .on("click", function (d, i) {
                let text = document.getElementById("text")
                text.innerHTML = '<b>query id(' + spe1 + '), subject id(' + spe2 + '), evalue, bit score<br></b>'
                text.innerHTML += i['value'];
            })
    }

    function chrWrite(chr, Y, width, chr_n, s, colors) {

        let a = 0
        let chr_f
        if (chr.length > 15) {
            chr_f = 8
        } else {
            chr_f = 18
        }
        for (let i in chr) {
            lineWrite(svg, [padding.left + a, Y], [padding.left + a + xScale(chr[i]['len']), Y], colors[i], width, chr[i]['name'])
            textWrite(svg, [padding.left + a + xScale(chr[i]['len']) / 2, Y + s], chr_f, 'Arial', 'black', chr[i]['name'])
            a += xScale(chr[i]['len'] + chr_n)

            svg.select('#' + chr[i]['name'])
                .on("mouseover", function () {
                    svg.style('cursor', 'pointer')
                    svg.selectAll('.' + chr[i]['name']).style('fill', 'red').style('stroke', 'red')
                })
                .on("mouseout", function () {
                    svg.selectAll('.' + chr[i]['name']).style('fill', colors[i]).style('stroke', colors[i])
                    svg.style('cursor', 'default')
                })
        }

    }

    function legend_write(chr1, chr2, colors1, colors2) {
        d3.select('#legend_synteny').remove()
        let nn = chr1[0]['name'][0].slice(0, 3)
        let chr1_len = chr1.length
        let chr2_len = chr2.length
        var legend = d3.select("#synteny").append("svg")
            .attr("width", 100)
            .attr("id", 'legend_synteny')
            .attr("height", hheight)
            .selectAll(".legend").data(
                function (d) {
                    if (chr2[0]['name'][0] === chr1[0]['name'][0]) {
                        return chr1
                    } else {
                        return d3.merge([chr1, chr2])
                    }
                }
            )
            .enter().append("g")
            .attr("class", "legend")
            .attr("transform", function (d, i) {
                let an = d['name'][0].slice(0, 3)
                if (an !== nn) {
                    if (chr2_len > 40) {
                        return "translate(40," + ((i - chr1.length) * 8 + 10) + ")";
                    } else if (chr2_len > 15) {
                        return "translate(40," + ((i - chr1.length) * 10 + 10) + ")";
                    } else {
                        return "translate(40," + ((i - chr1.length) * 18 + 10) + ")";
                    }
                } else {
                    if (chr1_len > 40) {
                        return "translate(0," + (i * 8 + 10) + ")";
                    } else if (chr1_len > 15) {
                        return "translate(0," + (i * 10 + 10) + ")";
                    } else {
                        return "translate(0," + (i * 18 + 10) + ")";
                    }
                }
            });  //transform属性便是整个图例的坐标

        legend.append("rect")
            .attr("x", 25) //width是svg的宽度，x属性用来调整位置
            // .attr("x", (wwidth / 40) * 39)
            //或者可以用width的分数来表示，更稳定一些，这是我试出来的，下面同
            .attr("y", 3)
            .attr("id", function (d) {
                return 'l' + d.name
            })
            .attr("width", 30)
            .attr("height", function (d) {
                let an = d['name'][0].slice(0, 3)
                if (an !== nn) {
                    if (chr2_len > 15) {
                        return 5;
                    } else {
                        return 12;
                    }
                } else {
                    if (chr1_len > 15) {
                        return 5;
                    } else {
                        return 12;
                    }
                }
            }) //设低一些就是线，高一些就是面，很好理解
            .style("fill", function (d, i) {
                let an = d['name'][0].slice(0, 3)
                if (an !== nn) {
                    return colors2[i - chr1_len];
                } else {
                    return colors1[i];
                }
            });
        legend.on("mouseover", function (d, i) {
            legend.style('cursor', 'pointer')
            svg.selectAll('.' + i.name).style('stroke', 'red').style('fill', 'red')
        })
            .on("mouseout", function (d, i) {
                let co = d3.select(this).select("rect").style("fill");
                svg.selectAll('.' + i.name).style('stroke', co).style('fill', co)
                svg.style('cursor', 'default')
            })
        legend.on("click", function (d, i) {
            let opacity = legend.select("#l" + i.name).style('fill-opacity');
            if (opacity === '0.3') {
                svg.selectAll("." + i.name).style('display', 'block')
                svg.select("#" + i.name).style('display', 'block')
                svg.select("#t_" + i.name).style('display', 'block')
                legend.select("#l" + i.name).style('fill-opacity', 1)
            } else {
                svg.selectAll("." + i.name).style('display', 'none')
                svg.select("#" + i.name).style('display', 'none')
                svg.select("#t_" + i.name).style('display', 'none')
                legend.select("#l" + i.name).style('fill-opacity', .30)
            }
        })
    }

    function startBrush() { // 开始框选
        stopZoom()
        brushBox = d_svg.append("g")
            .attr("transform", 'translate(' + trans.transform.x + ',' + trans.transform.y + ') scale(' + trans.transform.k + ')')
            .attr("class", "brushBox");
        brushBox.call(brush)
    }

    function stopZoom() {
        var bodyDom = d_svg;
        bodyDom.on("mousedown.zoom", null);
        bodyDom.on("mousemove.zoom", null);
        bodyDom.on("dblclick.zoom", null);
        bodyDom.on("touchstart.zoom", null);
        bodyDom.on("wheel.zoom", null);
        bodyDom.on("mousewheel.zoom", null);
        bodyDom.on("MozMousePixelScroll.zoom", null);
    }

    function brushed() {
// Using d3.brushSelection to get bounds of the brush[[x0, y0], [x1, y1]]
        const sel = d3.brushSelection(this);
        const dot1_x = sel[0][0]
        const dot1_y = sel[0][1]
        const dot2_x = sel[1][0]
        const dot2_y = sel[1][1]
        let x_chr, y_chr, chr1, chr2, lens1, lens2, sum1, sum2;
        x_chr = chr_dir[spe1];
        y_chr = chr_dir[spe2];
        [lens1, chr1] = lens(x_chr, spe1);
        [lens2, chr2] = lens(y_chr, spe2);
        sum1 = sum(x_chr)
        sum2 = sum(y_chr)
        let text = document.getElementById("text")
        text.innerHTML = '<b>query id, subject id, evalue, bit score<br></b>'

        datasets.forEach(({x, y, c1, c2, value}) => { // 新增代码部分
            if ((padding.left + d_xScale((Number(x) + lens1[Number(c1.slice(3)) - 1]) / sum1)) >= dot1_x && (padding.left + d_xScale((Number(x) + lens1[Number(c1.slice(3)) - 1]) / sum1)) <= dot2_x && (padding.top + d_yScale((Number(y) + lens2[Number(c2.slice(3)) - 1]) / sum2)) >= dot1_y && (padding.top + d_yScale((Number(y) + lens2[Number(c2.slice(3)) - 1]) / sum2)) <= dot2_y) { // 判段点在不在矩形上
                text.innerHTML += value + '<br>';
            }
        })
    }

    function stopBrush() { // 关闭框选
        d_svg.call(d_zoom).call(d_zoom.transform, d3.zoomIdentity.translate(trans.transform.x, trans.transform.y).scale(trans.transform.k))
        if (typeof brushBox?.remove === 'function') {
            brushBox.remove();
            brushBox = null;
        }
    }

    function reFresh() {
        svg.selectAll("rect").remove()
        svg.selectAll("path").remove()
        svg.selectAll("text").remove()
        draw_synteny()
        svg.call(zoom).call(zoom.transform, d3.zoomIdentity.scale(1))
    }

    function reFreshs() {
        d_svg.selectAll("circle").remove()
        d_svg.selectAll("line").remove()
        d_svg.selectAll("text").remove()
        draw_dotplot();
        d_svg.call(d_zoom).call(d_zoom.transform, d3.zoomIdentity.scale(1))
    }

    function textWrite(svg, [x, y], font_size, font_family, color, text) {
        svg.append('text')
            .style('font-family', font_family)
            .style('font-size', font_size)
            .text(text)
            .attr("id", 't_' + text)
            .attr("x", x)
            .attr('y', y)
            .attr('text-anchor', 'middle') // 水平居中
    }

    function draw_frame(svg, xLens, yLens, width, height) {
        let sumxLen = sum(xLens)
        let sumyLen = sum(yLens)
        let xLen = 0
        let yLen = 0
        let xFont, yFont
        if (xLens.length > 20) {
            xFont = 8
        } else {
            xFont = 15
        }
        if (yLens.length > 20) {
            yFont = 8
        } else {
            yFont = 15
        }
        for (let i in xLens) {
            textWrite(svg, [padding.left + (xLen + xLens[i] / 2) / sumxLen * width - 5, padding.top - 2], xFont, 'Arial', 'black', Number(i) + 1);
            xLen += xLens[i];
            d_lineWrite(svg, [padding.top + xLen / sumxLen * width, padding.left], [padding.top + xLen / sumxLen * width, padding.left + height], "black", "1px");
        }
        for (let i in yLens) {
            textWrite(svg, [padding.left - 20, padding.top + (yLen + yLens[i] / 2) / sumyLen * height + 5], yFont, 'Arial', 'black', Number(i) + 1);
            yLen += yLens[i];
            d_lineWrite(svg, [padding.top, padding.left + yLen / sumyLen * height], [padding.top + width, padding.left + yLen / sumyLen * height], "black", "1px");
        }
    }

    function rectWrite(svg, [x1, y1], width, height, color, size) {
        d_lineWrite(svg, [x1, y1], [x1 + width, y1], color, size);
        d_lineWrite(svg, [x1 + width, y1], [x1 + width, y1 + height], color, size);
        d_lineWrite(svg, [x1, y1], [x1, y1 + height], color, size);
        d_lineWrite(svg, [x1, y1 + height], [x1 + width, y1 + height], color, size);
    }

    function lineWrite(svg, [x1, y1], [x2, y2], color, width, id) {
        svg.append("rect")
            .attr("x", x1)
            .attr("y", y1 - (width / 2))
            .attr("id", id)
            .attr("width", x2 - x1)
            .attr("height", width)
            .attr("fill", color)
            .attr('rx', 5)
            .attr('stroke', 'black')
            .attr('stroke-width', 1.5);
    }

    function d_lineWrite(svg, [x1, y1], [x2, y2], color, width) {
        svg.append("line")
            .attr("x1", x1)
            .attr("y1", y1)
            .attr("x2", x2)
            .attr("y2", y2)
            .attr("stroke", color)
            .attr("stroke-width", width);
    }

    function sum_len(arr) {
        var sum = 0;
        for (let i in arr) {
            sum += arr[i]['len'];
        }
        return sum;
    }

    function lens(arr, na) {
        let sum = 0, arr_o = {}, chr_o = [];
        for (let i in arr) {
            arr_o[i] = sum;
            sum += arr[i];
            chr_o.push({'name': [na.toLowerCase() + (parseInt(i) + 1).toString()], 'len': arr[i]})
        }
        return [arr_o, chr_o];
    }

    function sum(arr) {
        var sum = 0;
        for (var i = 0; i < arr.length; i++) {
            sum += arr[i];
        }
        return sum;
    }

    function svgToPng(svg, pngWidth, pngHeight) {
        var serializer = new XMLSerializer();
        var source = '<?xml version="1.0" standalone="no"?>\r\n' + serializer.serializeToString(svg.node());
        var image = new Image;
        image.src = "data:image/svg+xml;charset=utf-8," + encodeURIComponent(source);
        image.onload = function () {
            var canvas = document.createElement("canvas");
            canvas.width = pngWidth;
            canvas.height = pngHeight;
            var context = canvas.getContext("2d");
            context.fillStyle = '#fff';//设置保存后的PNG 是白色的
            context.fillRect(0, 0, 10000, 10000);
            context.drawImage(image, 0, 0);
            const url = canvas.toDataURL("image/png");
            var pngName = "svgtoPng";
            var a = document.createElement("a");
            a.download = pngName + ".png";
            a.href = url;
            a.click();
        }
    }

    $('#imgSave').click(function () {
        svgToPng(svg, wwidth, hheight);
    })

    $('#imgsSave').click(function () {
        svgToPng(d_svg, d_wwidth, d_hheight);
    })

    function onDownload(data, type, name) {
        const blob = new Blob([data], {type}); // 返回一个新创建的 Blob 对象，其内容由参数中给定的数组串联组成。
        const url = window.URL.createObjectURL(blob); //创建一个url
        const link = document.createElement('a'); //创建一个a标签
        link.href = url; // 把url赋值给a标签的href
        link.style.display = 'none';
        link.setAttribute('download', name);
        document.body.appendChild(link);

        link.click(); // 触发a标签的点击事件
        URL.revokeObjectURL(url); // 清除Url
        document.body.removeChild(link);
    }

    function onSaveSvg(svg_in) { // 保存svg
        const svg = document.getElementById(svg_in);
        const source = new XMLSerializer().serializeToString(svg); //将整个SVG document 对象序列化为一个 XML 字符串。
        onDownload(source, 'text/xml', 'synteny.svg'); // 下载
    }

</script>
